import React from 'react';

function Projects() {
  return (
    <section id="projects" data-aos="fade-up">
      <h2>프로젝트</h2>
      <div className="project">
        <h3>포트폴리오 웹사이트</h3>
        <p>자신을 소개하는 포트폴리오 웹사이트를 제작하였습니다.</p>
      </div>
    </section>
  );
}

export default Projects;
